import React from 'react';
import './App.css';
import Page from './Components/Page';

export default class App extends React.PureComponent {
  constructor(props){
    super(props)
    this.state = {
      page: 'LandingPage',
      playlistNames: [
        {
          name: 'Example',
          songs: [
            {
              name: '3 nights by',
              artist: 'Dominic Fike'
            }, 
          ]
        }
      ],
      songNames: [
        {
          name: '3 nights by',
          artist: 'Dominic Fike'
        }, 
        {
          name: 'Bang!',
          artist: 'AJR',
        },
        {
          name: 'Tribe',
          artist: 'Jim Swim'
        },
        {
          name: 'Feels Right',
          artist: 'Danny\'s dead'
        },
        {
          name: 'Mariposa',
          artist: 'Peach Tree Rascals'
        },
        {
          name: 'Blinding Lights',
          artist: 'The Weeknd'
        },
        {
          name: 'Thriller',
          artist: 'Michael Jackson'
        },
        {
          name: 'Yellow Submarine',
          artist: 'The Beatles'
        },
        {
          name: 'USSR',
          artist: 'The Beatles'
        },
      ],
      librarySongNames: [
        {
          name: 'Mariposa',
          artist: 'Peach Tree Rascals'
        },
        {
          name: 'Blinding Lights',
          artist: 'The Weeknd'
        },
        {
          name: 'Thriller',
          artist: 'Michael Jackson'
        },
        {
          name: 'Yellow Submarine',
          artist: 'The Beatles'
        },
        {
          name: 'USSR',
          artist: 'The Beatles'
        },
      ],
    }
  }

  changeState = (newPage) => {
    this.setState({page: newPage})
  }

  render() {
    return (
      <div className="App">
        {state.page === 'LandingPage' &&
          <Page pageChanger = {this.changeState}/>
        }
        {state.page === 'Playlists' &&
          <Page 
            pageChanger = {this.changeState} 
            contents = {
              <ListView pageChanger = {this.changeState} data = {this.state.playlistNames}/>
            }
          />
        }
        {state.page === 'NowPlaying' &&
          <Page 
            pageChanger = {this.changeState} 
            contents = {
              <Image />
            }
          />
        }
        {state.page === 'Search' &&
          <Page 
            pageChanger = {this.changeState} 
            contents = {
              <ListView pageChanger = {this.changeState} data = {this.state.songNames}/>
            }
          />
        }
        {state.page === 'Library' &&
          <Page 
            pageChanger = {this.changeState} 
            contents = {
              <ListView pageChanger = {this.changeState} data = {this.state.librarySongNames}/>
            }
          />
        }
      </div>
    )
  };
}
